       setToEdit(e)
      
       console.log(Editdat);
       
  }
  return(
    <tr className="odd">
    <td>1</td>
    <td>{reportdata.reportdate}</td>
    <td>{reportdata.Client}</td>
    <td>{reportdata.startEnd}</td>
    <td>{reportdata.Totalhrs}</td>
